import React from "react";
import { Button, UncontrolledTooltip } from "reactstrap";


export const RenderIcon = ({ name }) => {
  switch (name) {
    case "react": 
      return <ReactIcon />
    case "react-native":
      return <ReactNativeIcon />
    case "javascript": 
      return <JSIcon />
    case "express": 
      return <ExpressJSIcon />
    case "django":
      return <DjangoIcon />
    case "python": 
      return <PythonIcon />
    case "html": 
      return <HTMLIcon />
    case "postgres":
      return <PostgresIcon />
    case "android":
      return <AndroidIcon />
    default: 
      return <JSIcon />
  }
}
export const ReactNativeIcon = props => {
  return (
    <>
      <Button
        className="btn-icon btn-round"
        color="white"
        id="react"
      >
        <i className="devicon-react-original colored" />
      </Button>
      <UncontrolledTooltip delay={0} target="react" placement="bottom">
        React Native
      </UncontrolledTooltip>
    </>
  );
};

export const ReactIcon = props => {
  return (
    <>
      <Button
        className="btn-icon btn-round"
        color="white"
        id="react"
      >
        <i className="devicon-react-original colored" />
      </Button>
      <UncontrolledTooltip delay={0} target="react" placement="bottom">
        React
      </UncontrolledTooltip>
    </>
  );
};

export const JSIcon = props => {
  return (
    <>
      <Button
        className="btn-icon btn-round"
        color="white"
        id="js"
      >
        <i className="devicon-javascript-plain colored" />
      </Button>
      <UncontrolledTooltip delay={0} target="js" placement="bottom">
        Javascript
      </UncontrolledTooltip>
    </>
  );
};

export const ExpressJSIcon = props => {
  return (
    <>
      <Button
        className="btn-icon btn-round"
        color="white"
        id="express"
      >
        <i className="devicon-express-original" />
      </Button>
      <UncontrolledTooltip delay={0} target="express" placement="bottom">
        ExpressJS
      </UncontrolledTooltip>
    </>
  );
};

export const DjangoIcon = props => {
  return (
    <>
      <Button
        className="btn-icon btn-round"
        color="white"
        id="django"
      >
        <i className="devicon-django-line" />
      </Button>
      <UncontrolledTooltip delay={0} target="django" placement="bottom">
        Django
      </UncontrolledTooltip>
    </>
