};

export const PythonIcon = props => {
  return (
    <>
      <Button
        className="btn-icon btn-round"
        color="white"
        id="python"
      >
        <i className="devicon-python-plain colored" />
      </Button>
      <UncontrolledTooltip delay={0} target="python" placement="bottom">
        Python
      </UncontrolledTooltip>
    </>
  );
};

